  return (
    <div className="bg-white p-4 rounded shadow mb-6">
      <h2 className="text-xl font-bold mb-4">ðŸ’¬ Behavioral Questions</h2>
      {questions.map((q, idx) => (
        <div key={idx} className="mb-4">
          <label className="block font-medium mb-1">{q.question}</label>
          <textarea rows={3} className="w-full border p-2 rounded" placeholder="Your answer..." />
        </div>
      ))}
    </div>
  );
};

export default BehavioralSection;
